abstract_text:
A method for the photolithographic production of structures in the submicron range including the following steps: 
     - a photoresist layer comprising a polymer containing carboxylic acid anhydride and carboxylic acid tert. butyl ester groups, a photoinitiator which releases an acid when exposed, and a suitable solvent is applied to a substrate; 
     - the photoresist layer is dried; 
     - the photoresist layer is exposed in an imagewise manner; 
     - the exposed photoresist layer is subjected to temperature treatment; 
     - the photoresist layer treated in this way is subjected to liquid silylation; 
     - the silylated photoresist layer is dry-developed in an anisotropic oxygen plasma; 
     where the temperature treatment is handled in such a way that the photoresist becomes hydrophilic in the exposed areas.
